  \"2016-10-26T12:36:39.353323\",\n\t\"name\": \"state-of-iowa-budget-dispositions-by-fiscal-year-and-budget-org-unit\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides information on budgeted
  expenditures, and balance carry forwards for both funds and appropriations by fiscal
  year starting in FY 2010. The data provides granular detail down to the budget organizational
  unit and and object class/job class for the department request, the Governor's recommendation,
  and the adopted budget.rnrnThe state fiscal year runs from July 1 to the following
  June 30 and is numbered for the calendar year in which it ends. The State of Iowa
  operates on a modified accrual basis which provides that encumbrances on June 30
  must be paid within 60 days after year end. The Legislature may enact exceptions
  to this statute and usually do so for capital items which may run for several years.rnrnDepartment
  names and budget units for FY 2010 - 2015 are based on names used in FY 2016.\",\n\t\"license_title\":
